function ScoreBoard() {
  return (
    <Card raised variant="outlined" sx={{textAlign: "center",width: "150px"}} >
      <CardHeader title="Score"/>
      <CardContent>
        <Typography variant="body1">
            10
        </Typography>
      </CardContent>
      {/* <Typography variant="h5">Score: 0</Typography> */}
    </Card>
  );
}

export default ScoreBoard;
